import React from "react";
import "../../App.css";
import Aos from "aos";
import "aos/dist/aos.css";
import { useEffect } from "react";
import { Container, Grid, Box } from "@material-ui/core";
import r1 from "../pages/SyImg/proimg/1-150x150.jpeg";
import r11 from "../pages/SyImg/proimg/1-650x650.jpeg";
import r2 from "../pages/SyImg/proimg/2-150x150.jpeg";
import r22 from "../pages/SyImg/proimg/2-650x650.jpeg";
import r3 from "../pages/SyImg/proimg/3-150x150.jpeg";
import r33 from "../pages/SyImg/proimg/3-650x650.jpeg";
import "photoswipe/dist/photoswipe.css";
import "photoswipe/dist/default-skin/default-skin.css";

import { Gallery, Item } from "react-photoswipe-gallery";

export default function Products() {
  useEffect(() => {
    Aos.init({ duration: 2000 });
    Aos.refresh();
  }, []);

  return (
    <div>
      <div className="urunler"></div>
      <Container>
        <Gallery>
          <Grid container spacing={4} direction="row">
            <Grid item xs={12} md={4} xl={3} data-aos="fade-up" m={2}></Grid>
          </Grid>

          <Item original={r11} thumbnail={r1} width="1024" height="768">
            {({ ref, open }) => <img ref={ref} onClick={open} src={r1} />}
          </Item>
          <Item original={r22} thumbnail={r22} width="1024" height="768">
            {({ ref, open }) => <img ref={ref} onClick={open} src={r2} />}
          </Item>
        </Gallery>
      </Container>
    </div>
  );
}
